('et', '_template', 'chat_help_display_blurb', '<p>Teadmiseks: <em>Hüppa</em> lingid ja <em>Kiirvklahvid</em> menüü ilmub ainult siis, kui oled eelistustest lubanud <em>Navigeerimise abi</em>.</p>\r\n\r\n<ul>\r\n<li><em>Hüppa kiirklahvide juurde</em> viide lehekülje ülaosas viib sind jututoa kiirklahvide juurde. </li>\r\n<li><em>Sõnumiala</em> näitab kuni kümmet värskemat sõnumit. </li>\r\n<li><em>Hüppa sõnumitesse</em> viide viib su sõnumite nimekirja algusesse. (Alt+M) </li>\r\n<li><em>Värskenda sõnumeid</em> viide kontrollib uusi sõnumeid. (Alt+R) </li>\r\n<li>Väli <em>Sõnumi koostamine</em> ja nupp <em>Saatmine</em> lasevad sul sõnumeid sisestada ja saata. (Alt+C viib sõnumi väljale ja Enter saadab sõnumi) </li>\r\n</ul>', '2007-11-25 11:26:51', ''),
